import style  from "./crud.module.css"
import axios from "axios"
import { useEffect, useState } from "react"
const Users=()=>{
    let [user,setUser]=useState([])
    useEffect(()=>{
        axios.get("http://localhost:3000/employees")
        .then((response)=>{setUser(response.data)})
        .catch(()=>{console.log("error");})
    })
    return(
       
        <div id={style.user}>
             <h1 id={style.heading}>NAME</h1>
             <h1 id={style.heading}>SALARY</h1>
             <h1 id={style.heading}>COMPANY</h1>
             <div>
            {user.map((detail)=>{
               return( <h2 key={detail.id}>{detail.empName}</h2>)
            })}
            {user.map((detail)=>{
               return( <h2 key={detail.id}>{detail.empSalary}</h2>)
            })}
            {user.map((detail)=>{
               return( <h2 key={detail.id}>{detail.empCompany}</h2>)
            })}
            </div>


        </div>
    )
}
export default Users
